            <ul className="todo-main">
                {
                    this.props.list.map((value,index) =>{
                        return (
                            <li>
                                <label>
                                    <input type="checkbox"/>
                                    <span>xxxxx</span>
                                </label>
                                <button className="btn btn-danger" style={{display: 'none'}}>删除</button>
                            </li>
                        )
                    })
                }
            </ul>
        )
    }
}
